CREATE TABLE [MATCHES] ( MATCH_ID INT, TEAM_ONE_ID INT, TEAM_TWO_ID INT, TEAM_ONE_SCORE INT, TEAM_TWO_SCORE INT, WINNER_ID INT, TIMESTAMP DATETIME, PRIMARY KEY (MATCH_ID));


CREATE TABLE [GAMES] (GAME_ID INT, MATCH_ID INT, MAP TEXT, PRIMARY KEY (GAME_ID));


CREATE TABLE [TEAMS] (TEAM_ID INT, TEAM_NAME TEXT, TEAM_LOCATION TEXT, PRIMARY KEY (TEAM_ID));


CREATE TABLE [PLAYERS] (COMPETITOR_ID INT,TEAM_ID INT, HANDLE TEXT, ROLE TEXT, NUMBER INT,NAME TEXT,PHOTO TEXT,PRIMARY KEY (COMPETITOR_ID));

